%CLIBISNULL Determine if a MATLAB C++ object is null
%
%   CLIBISNULL(OBJ) returns logical 1 (true) if the MATLAB C++ library
%   object is null or returns logical 0 (false) otherwise.
%
%   OBJ must be a MATLAB C++ library object. If the MATLAB C++ library
%   object is null (nullptr), then logical 1 is returned.  If
%   the MATLAB C++ library object is not null, then
%   logical 0 (false) is returned. 

